export class InMemoryStorage {
    storage;
    constructor() {
        this.storage = new Map();
    }
    get(key) {
        return this.storage.get(key) ?? null;
    }
    set(key, value) {
        this.storage.set(key, value);
    }
    delete(key) {
        this.storage.delete(key);
    }
    has(key) {
        return this.storage.has(key);
    }
}
